class Solution {
    func minSum(_ nums1: [Int], _ nums2: [Int]) -> Int {
        let sum1 = nums1.reduce(0, +)
        let sum2 = nums2.reduce(0, +)
        let zeros1 = nums1.filter { $0 == 0 }.count
        let zeros2 = nums2.filter { $0 == 0 }.count

        if zeros1 == 0 && zeros2 == 0 {
            return sum1 == sum2 ? sum1 : -1
        } else if zeros1 == 0 {
            return sum1 > sum2 ? -1 : sum1 + zeros2
        } else if zeros2 == 0 {
            return sum2 > sum1 ? -1 : sum2 + zeros1
        } else {
            let totalZeros = zeros1 + zeros2
            let diff = abs(sum1 - sum2)
            if diff % totalZeros == 0 {
                return max(sum1, sum2) + diff / totalZeros * min(zeros1, zeros2)
            } else {
                return -1
            }
        }
    }
}
